description:
Ubuntu Linux is desktop operating system. Autors of distribution choose from huge Debian repositories in their opinion the best and the most stable applications necessary to make computer as usefull as it possible. Ubuntu is ready to use just after installation and even befor (live cd). In fact that Debian packages are available so you can customize OS to you.


